import './App.css';
import Testimonio from './componentes/Testimonios.jsx';

function App() {
  return (
    <div className="App">
      <Testimonio
        imagen = "1"
        nombre = "Ema Bostian"
        pais = "Suecia"
        cargo = "Ingeniera de Software"
        empresa = "Sistemas Enlinea"
        testimonio = "lorem"

      />
    </div>
  );
}

export default App;
